import base64
import random
from typing import Literal
from pathlib import Path
from fastapi import FastAPI, Request
from fastapi.responses import HTMLResponse
from fastapi.middleware.cors import CORSMiddleware
from fastapi.templating import Jinja2Templates
from pydantic import BaseModel
import uvicorn

# Initialize App
app = FastAPI()

# --- FIX: ROBUST TEMPLATE PATH ---
# This ensures it finds 'templates' relative to this file (app/main.py), 
# regardless of where you run the uvicorn command from.
BASE_DIR = Path(__file__).resolve().parent
templates = Jinja2Templates(directory=str(BASE_DIR / "templates"))

# CORS Configuration (Allow Frontend access)
app.add_middleware(
    CORSMiddleware,
    allow_origins=["*"],
    allow_methods=["*"],
    allow_headers=["*"],
)

# --- CONFIGURATION: SIMULATED IMAGES ---
# Placeholder strings for demo purposes
IMG_SMOKE = ""
IMG_CLEAN = ""

# --- SIMULATION STATE ---
class SimState:
    mode: Literal["NORMAL", "CRITICAL", "STOPPED"] = "NORMAL"
    torque_limit: int = 100
    temp: float = 45.0
    risk: float = 0.15

sim_state = SimState()

# --- DATA MODELS ---
class IoTCommand(BaseModel):
    asset_id: str
    command: str
    value: str

# --- ENDPOINTS ---

@app.get("/", response_class=HTMLResponse)
async def read_dashboard(request: Request):
    """Serves the Simulator Control Dashboard."""
    return templates.TemplateResponse("index.html", {"request": request, "state": sim_state})

@app.post("/api/command")
def receive_iot_command(cmd: IoTCommand):
    """Receives IoT commands from Salesforce (The 'Hands')."""
    print(f"Received IoT Command: {cmd}")
    
    if cmd.command == "DERATE":
        # Simulate physical intervention
        sim_state.torque_limit = 70
        # Automatically cool down the system logic
        sim_state.mode = "NORMAL"
        sim_state.temp = 60.0 # Cooling down
        sim_state.risk = 0.40
        
    return {"status": "executed", "new_torque": sim_state.torque_limit}

@app.post("/api/control/{mode}")
def set_mode(mode: Literal["NORMAL", "CRITICAL", "STOPPED"]):
    """Manual Fault Injection / Control Endpoint."""
    sim_state.mode = mode
    
    if mode == "CRITICAL":
        # Simulate Thermal Runaway Event
        sim_state.temp = 85.0
        sim_state.risk = 0.92
    elif mode == "NORMAL":
        # Reset to Nominal
        sim_state.temp = 45.0
        sim_state.risk = 0.15
        sim_state.torque_limit = 100
        
    return {"status": "updated", "mode": mode}

@app.get("/api/telemetry/snapshot")
def get_snapshot():
    """Provides real-time telemetry stream to Frontend & Data Cloud."""
    
    # Add physics jitter for realism
    jitter = random.uniform(-0.5, 0.5)
    current_temp = sim_state.temp + jitter
    
    # Logic: Only send the "Smoke" image if we are in CRITICAL mode
    current_image = IMG_SMOKE if sim_state.mode == "CRITICAL" else IMG_CLEAN
    
    # Logic: Calculate ESR based on mode
    current_esr = 2.5 if sim_state.mode == "CRITICAL" else 0.45

    return {
        "trrs_score": sim_state.risk,
        "core_temp": current_temp,
        "esr_value": current_esr,
        "vision_base64": current_image,
        "torque_limit": sim_state.torque_limit,
        "status": sim_state.mode
    }

if __name__ == "__main__":
    uvicorn.run(app, host="0.0.0.0", port=8080)